export const inputTitlesHeat = [
  { title: "Length [m]", type: "", varName: "length" },
  { title: "Height [m]", type: "", varName: "height" },
  { title: "Tube Pitch [m]", type: "", varName: "tubePitch" },
  { title: "Row Pitch [m]", type: "", varName: "rowPitch" },
  { title: "Rows [-]", type: "", varName: "rows" },
  { title: "Control Areas [-]", type: "", varName: "controlAreas" },
];

export const inputTitlesTubeParameters = [
