  { title: "Wall Thickness [m]", type: "", varName: "wallThickness" },
];

export const inputTitlesFinParameters = [
  { title: "Fin Pitch [m]", type: "", varName: "finPitch" },
  { title: "Fin Thickness [m]", type: "", varName: "finThickness" },
];

export const inputTitlesWaterParameters = [
  { title: "Temperature - Inlet [C]", type: "", varName: "temperature" },
  { title: "Water Flow(s) [kg/s]", type: "", varName: "flow" },
];

export const inputTitlesAirParameters = [
  { title: "Temperature - Inlet [C]", type: "", varName: "temperature" },
  { title: "Air Flow(s) [m/s]", type: "", varName: "flow" },
];

